// src/components/HomePage.js
import React from 'react';
import BlogPosts from '../components/';
import Sidebar from './Sidebar';

const HomePage = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-9">
          <BlogPosts />
        </div>
        <div className="col-md-3">
          <Sidebar />
        </div>
      </div>
    </div>
  );
};

export default HomePage;
